export default{
    state:{
        isCollapse:false,//控制菜单的展开收起
        tabList:[
            {
                path: '/',
                name: 'main',
                lable: '首页',
                icon: 's-home',
                url: 'Home/home'
            },
        ]//面包屑数据
    },
    mutations:{
        //修改菜单展开收起的方法
        collapseMenu(state){
            state.isCollapse=!state.isCollapse
        },
        upad
    }
}
